import "./App.css";
import { React } from "react";
import { Home } from "./Home";
import {Routes,Route} from "react-router-dom";
import { GetSearchData } from "./Components/GetSearchData";

function App() {  


  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/search" element={<GetSearchData />} />

    </Routes>
  )
}

export default App;
